const KEY_DOWN=40,KEY_UP=38;function focusPreviousItem(e){e.preventDefault();const t=e.target,n=t.nextElementSibling;if(n&&n.matches("ul")){const e=n.querySelector("li:last-child > a");e&&e.focus()}else{const e=t.parentNode;if(e){const t=e.previousElementSibling,n=e.parentNode.lastElementChild;(t||n).firstElementChild.focus()}}}function focusNextItem(e){e.preventDefault();const t=e.target,n=t.nextElementSibling;if(n&&n.matches("ul")){const e=n.querySelector("li:first-child > a");e&&e.focus()}else{const e=t.parentNode;if(e){const t=e.nextElementSibling,n=e.parentNode.firstElementChild;(t||n).firstElementChild.focus()}}}document.addEventListener("DOMContentLoaded",(e=>{const t=document.querySelector(".navbar");t&&t.addEventListener("keydown",(e=>{switch(e.keyCode){case 38:focusPreviousItem(e);break;case 40:focusNextItem(e)}}))}));